/* after changing this file run 'yarn run webpack:build' */
/* tslint:disable */
import '../content/scss/vendor.scss';

// Imports all fontawesome core and solid icons

import { library } from '@fortawesome/fontawesome-svg-core';
import {
    faUser,
    faSort,
    faSortUp,
    faSortDown,
    faSync,
    faEye,
    faBan,
    faTimes,
    faArrowLeft,
    faSave,
    faPlus,
    faPencilAlt,
    faBars,
    faThList,
    faUserPlus,
    faRoad,
    faTachometerAlt,
    faHeart,
    faList,
    faBell,
    faBook,
    faHdd,
    faFlag,
    faWrench,
    faClock,
    faCloud,
    faSignOutAlt,
    faSignInAlt,
    faCalendarAlt,
    faSearch,
    faTrashAlt,
    faAsterisk,
    faTasks,
    faHome,
    faShoppingCart,
    faPlay,
    faPause,
    faFastForward,
    faStepForward,
    faFastBackward,
    faStepBackward,
    faDownload,
    faHistory,
    faChalkboardTeacher,
    faAtlas,
    faAward,
    faHandsHelping,
    faInfoCircle,
    faUserGraduate,
    faSmile,
    faUserTie,
    faCheckSquare,
    faCheck, faUniversity, faUserAltSlash, faShoppingBag, faUserAlt
} from '@fortawesome/free-solid-svg-icons';

// Adds the SVG icon to the library so you can use it in your page
library.add(faChalkboardTeacher);
library.add(faAtlas);
library.add(faInfoCircle);
library.add(faAward);
